css:
atom-text-editor,
:host {
  background-color: #212121;
  color: #e0e0e0;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #424242;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #424242;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #424242;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #1a1a1a;
  color: #e0e0e0;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #084e86;
  color: #e0e0e0;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #e0e0e0;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #eeeeee;
}
atom-text-editor .invisible,
:host .invisible {
  color: #e0e0e0;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #484848;
}
.line.cursor-line {
  background: #303030 !important;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #eeeeee;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #78909c;
}
.entity.name.type {
  color: #ffffff;
  font-weight: bold;
}
.entity.other.inherited-class {
  color: #ffffff;
}
.keyword {
  color: #b388ff;
}
.keyword.control {
  color: #8bc34a;
}
.keyword.operator {
  color: #8bc34a;
}
.keyword.other.special-method {
  color: #64b5f6;
}
.keyword.other.unit {
  color: #fff176;
}
.storage {
  color: #64b5f6;
}
.storage.todo,
.storage.fixme,
.storage.changed,
.storage.idea,
.storage.xxx,
.storage.hack {
  color: #ec407a;
}
.storage.modifier {
  color: #64b5f6;
}
.constant {
  color: #fff176;
}
.constant.character.escape {
  color: #80cbc4;
}
.constant.numeric {
  color: #e0e0e0;
}
.constant.other.color {
  color: #80cbc4;
}
.constant.other.symbol {
  color: #8bc34a;
}
.variable {
  color: #ef5350;
}
.variable.interpolation {
  color: #eb2521;
}
.variable.parameter.function {
  color: #e0e0e0;
}
.invalid.illegal {
  background-color: #ef5350;
  color: #212121;
}
.string {
  color: #fff176;
}
.string.regexp {
  color: #80cbc4;
}
.string.regexp .source.ruby.embedded {
  color: #fff176;
}
.string.other.link {
  color: #ef5350;
}
.punctuation.definition.comment {
  color: #78909c;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #fff176;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #64b5f6;
}
.punctuation.definition.bold {
  color: #ff8a65;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b388ff;
  font-style: italic;
}
.punctuation.definition.method-parameters.begin.java {
  color: #8bc34a;
}
.punctuation.definition.method-parameters.end.java {
  color: #8bc34a;
}
.punctuation.section.embedded {
  color: #eb2521;
}
.support.class {
  color: #ff8a65;
}
.support.function {
  color: #80cbc4;
}
.support.function.any-method {
  color: #64b5f6;
}
.entity.name.function {
  color: #ffffff;
  font-weight: bold;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffffff;
  font-weight: bold;
}
.entity.name.section {
  color: #64b5f6;
}
.entity.name.tag {
  color: #ef5350;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #fff176;
}
.entity.other.attribute-name.id {
  color: #64b5f6;
}
.meta.class {
  color: #e0e0e0;
}
.meta.link {
  color: #fff176;
}
.meta.require {
  color: #64b5f6;
}
.meta.brace.curly {
  color: #80cbc4;
}
.meta.brace.round {
  color: #80cbc4;
}
.meta.selector {
  color: #b388ff;
}
.meta.separator {
  background-color: #424242;
  color: #e0e0e0;
}
.none {
  color: #e0e0e0;
}
.markup.bold {
  color: #fff176;
  font-weight: bold;
}
.markup.changed {
  color: #b388ff;
}
.markup.deleted {
  color: #ef5350;
}
.markup.italic {
  color: #b388ff;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #64b5f6;
}
.markup.inserted {
  color: #8bc34a;
}
.markup.list {
  color: #ef5350;
}
.markup.quote {
  color: #fff176;
}
.markup.raw.inline {
  color: #8bc34a;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #8bc34a;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.bracket-matcher.region {
  background: rgba(100, 181, 246, 0.55);
  border-radius: 0rem;
}
